import Dropdown from "react-bootstrap/Dropdown";

function LanguageSelector(){
    return <Dropdown>
        <Dropdown.Toggle><img src="/images/br.svg" width="16" roundedCircle /></Dropdown.Toggle>
        <Dropdown.Menu>
            <Dropdown.Item><img src="/images/br.svg" width="16" roundedCircle /></Dropdown.Item>
            <Dropdown.Item><img src="/images/es.svg" width="16" roundedCircle /></Dropdown.Item>
            <Dropdown.Item><img src="/images/gb.svg" width="16" roundedCircle /></Dropdown.Item>
        </Dropdown.Menu>
    </Dropdown>;
}

export default LanguageSelector;
